import React from "react";

function HomeBanner() {
  return (
    <div>
      <div className="HBanner">
        <ul className="BannerPics">
          <li>
            <img src="https://i.pinimg.com/736x/63/cf/25/63cf25eaeb581d8787cd5c3bfaf899d1--goku-pictures-dragon-ball.jpg" />
          </li>
        </ul>
      </div>
    </div>
  );
}

export default HomeBanner;
